import{_ as i}from"./plugin-vue_export-helper.21dcd24c.js";import{o as l,c as a,d as e}from"./app.d6b42b88.js";const r={},h=e('<div class="custom-container tip"><p class="custom-container-title">GOAL</p><p>Q. \uAC00\uC0C1\uBA54\uBAA8\uB9AC\uC758 \uAC1C\uB150\uACFC \uC0AC\uC6A9\uC2DC \uC7A5\uC810\uC740 \uBB34\uC5C7\uC778\uAC00\uC694?<br> Q. \uD398\uC774\uC9C0 \uD3F4\uD2B8\uC640 \uD398\uC774\uC9C0 \uB300\uCE58\uB780 \uBB34\uC5C7\uC778\uAC00\uC694?<br> Q. \uC2A4\uB808\uC2F1 \uBB38\uC81C\uB780 \uBB34\uC5C7\uC778\uAC00\uC694?</p></div><p>\uD574\uB2F9\uD398\uC774\uC9C0\uB294 2022\uB144 3\uC6D4 \uB178\uC158\uC5D0\uC11C \uB9C8\uC774\uADF8\uB808\uC774\uC158 \uB418\uC5C8\uC2B5\uB2C8\uB2E4.</p><h2 id="\u1100\u1161\u1109\u1161\u11BC-\u1106\u1166\u1106\u1169\u1105\u1175-\u1100\u1162\u1102\u1167\u11B7" tabindex="-1"><a class="header-anchor" href="#\u1100\u1161\u1109\u1161\u11BC-\u1106\u1166\u1106\u1169\u1105\u1175-\u1100\u1162\u1102\u1167\u11B7" aria-hidden="true">#</a> \uAC00\uC0C1 \uBA54\uBAA8\uB9AC \uAC1C\uB150</h2><ul><li><p>\uBC30\uACBD \uC55E\uC120 \uBA54\uBAA8\uB9AC \uAD00\uB9AC\uB294 <strong>\uC2E4\uD589\uC911\uC778 \uCF54\uB4DC\uB294 \uBC18\uB4DC\uC2DC \uBB3C\uB9AC \uBA54\uBAA8\uB9AC\uC5D0 \uC788\uC5B4\uC57C \uD588\uB2E4</strong> \uC624\uB958\uCF54\uB4DC\uB098, \uB9CE\uC740 \uACF5\uAC04\uC744 \uC810\uC720\uD558\uB294 \uC790\uB8CC\uAD6C\uC870, \uC635\uC158\uC774\uB098 \uC790\uC8FC \uC0AC\uC6A9\uB418\uC9C0 \uC54A\uB294 \uAE30\uB2A5\uB4E4\uB3C4 \uD56D\uC0C1 \uBA54\uBAA8\uB9AC\uC5D0 \uC801\uC7AC\uB418\uC5B4\uC788\uC5B4\uC57C \uD560\uAE4C?<br> =&gt; \uD504\uB85C\uADF8\uB7A8\uC744 \uC77C\uBD80\uBD84\uB9CC \uBA54\uBAA8\uB9AC\uC5D0 \uC62C\uB824\uB193\uACE0 \uC2E4\uD589\uD558\uBA74 \uC5B4\uB5A8\uAE4C?</p></li><li><p>\uC7A5\uC810</p><ul><li>\uD504\uB85C\uADF8\uB7A8\uC774 \uBB3C\uB9AC \uBA54\uBAA8\uB9AC \uD06C\uAE30\uC5D0 \uB354 \uC774\uC0C1 \uC81C\uC57D \uBC1B\uC9C0 \uC54A\uAC8C \uB428</li><li>\uB354 \uB9CE\uC740 \uD504\uB85C\uADF8\uB7A8\uC744 \uB3D9\uC2DC\uC5D0 \uC218\uD589\uD560 \uC218 \uC788\uC74C</li><li>\uD504\uB85C\uADF8\uB7A8\uC744 \uBA54\uBAA8\uB9AC\uC5D0 \uC62C\uB9AC\uACE0 \uC2A4\uC651\uD558\uB294\uB370 \uD544\uC694\uD55C \uC785\uCD9C\uB825 \uD69F\uC218\uAC00 \uC904\uC5B4\uB4E4\uAE30 \uB54C\uBB38\uC5D0 \uD504\uB85C\uADF8\uB7A8\uB4E4\uC774 \uBCF4\uB2E4 \uBE68\uB9AC \uC2E4\uD589\uB428</li><li>\uD398\uC774\uC9C0 \uACF5\uC720\uB97C \uD1B5\uD574 \uB458 \uC774\uC0C1\uC758 \uD504\uB85C\uC138\uC2A4\uC5D0\uC11C \uD30C\uC77C\uACFC \uBA54\uBAA8\uB9AC\uB97C \uACF5\uC720\uD560 \uC218 \uC788\uC74C <ul><li>\uB77C\uC774\uBE0C\uB7EC\uB9AC\uAC00 \uC874\uC7AC\uD558\uB294 \uBB3C\uB9AC \uBA54\uBAA8\uB9AC \uD398\uC774\uC9C0\uB4E4\uC740 \uBAA8\uB4E0 \uD504\uB85C\uC138\uC2A4\uC5D0\uAC8C \uACF5\uC720\uB418\uACE0 \uC788\uC74C</li><li>\uD55C \uD504\uB85C\uC138\uC2A4\uAC00 \uB2E4\uB978 \uD504\uB85C\uC138\uC2A4\uC640 \uACF5\uC720\uD560 \uC218 \uC788\uB294 \uBA54\uBAA8\uB9AC \uC601\uC5ED\uC744 \uC0DD\uC131\uD560 \uC218 \uC788\uC74C</li></ul></li></ul></li><li><p>\uD2B9\uC9D5</p><ul><li>\uC2E4\uC81C\uC758 \uBB3C\uB9AC \uBA54\uBAA8\uB9AC \uAC1C\uB150\uACFC \uC0AC\uC6A9\uC790\uC758 \uB17C\uB9AC \uBA54\uBAA8\uB9AC \uAC1C\uB150\uC744 \uBD84\uB9AC</li><li>\uC791\uC740 \uBA54\uBAA8\uB9AC\uB97C \uAC00\uC9C0\uACE0\uB3C4 \uC5BC\uB9C8\uB4E0\uC9C0 \uD070 \uAC00\uC0C1 \uC8FC\uC18C \uACF5\uAC04\uC744 \uD504\uB85C\uADF8\uB798\uBA38\uC5D0\uAC8C \uC81C\uACF5\uD560 \uC218 \uC788\uC74C</li><li>\uD55C \uD504\uB85C\uC138\uC2A4\uC758 \uAC00\uC0C1 \uC8FC\uC18C \uACF5\uAC04\uC740 \uADF8 \uD504\uB85C\uC138\uC2A4\uAC00 \uBA54\uBAA8\uB9AC\uC5D0 \uC800\uC7A5\uB418\uB294 \uB17C\uB9AC\uC801\uC778 \uBAA8\uC2B5(view) <ul><li>\uB3D9\uC801 \uBA54\uBAA8\uB9AC \uD560\uB2F9\uC5D0 \uC0AC\uC6A9\uB418\uBBC0\uB85C \uD799\uC774 \uBA54\uBAA8\uB9AC\uC5D0\uC11C \uC704\uCABD\uC73C\uB85C \uC99D\uAC00\uD558\uB3C4\uB85D \uD5C8\uC6A9</li><li>\uC5F0\uC18D\uC801\uC778 \uD568\uC218 \uD638\uCD9C\uC744 \uC704\uD574 \uC2A4\uD0DD\uC774 \uBA54\uBAA8\uB9AC\uC5D0\uC11C \uC544\uB798\uCABD\uC73C\uB85C \uCEE4\uC9C0\uB3C4\uB85D \uD5C8\uC6A9</li></ul></li></ul></li></ul><h2 id="\u110B\u116D\u1100\u116E-\u1111\u1166\u110B\u1175\u110C\u1175\u11BC" tabindex="-1"><a class="header-anchor" href="#\u110B\u116D\u1100\u116E-\u1111\u1166\u110B\u1175\u110C\u1175\u11BC" aria-hidden="true">#</a> \uC694\uAD6C \uD398\uC774\uC9D5</h2><p>\uAC00\uC7A5 \uC77C\uBC18\uC801\uC778 \uAC00\uC0C1 \uBA54\uBAA8\uB9AC \uCCB4\uACC4\uB85C \uC2A4\uC640\uD551\uC744 \uC0AC\uC6A9\uD558\uB294 \uD398\uC774\uC9D5 \uC2DC\uC2A4\uD15C\uACFC \uBE44\uC2B7\uD558\uB2E4. \uD504\uB85C\uADF8\uB7A8\uC744 \uC2E4\uD589\uD558\uB824\uACE0 \uD504\uB85C\uADF8\uB7A8\uC758 \uC77C\uBD80\uB9CC \uBA54\uC778 \uBA54\uBAA8\uB9AC\uC5D0 \uC801\uC7AC\uD55C\uB2E4. \uC21C\uCC28\uC801\uC73C\uB85C \uC791\uC131\uB418\uC5B4 \uC788\uB294 \uD504\uB85C\uADF8\uB7A8\uC758 \uBAA8\uB4C8\uC744 \uCC98\uB9AC\uD560 \uB54C \uB2E4\uB978 \uBD80\uBD84\uC740 \uC2E4\uD589\uD558\uC9C0 \uC54A\uB294\uB2E4\uB294 \uD2B9\uC9D5\uC744 \uC774\uC6A9\uD55C\uB2E4. \uBA54\uBAA8\uB9AC\uB97C \uD6A8\uC728\uC801\uC73C\uB85C \uC0AC\uC6A9\uD560 \uC218 \uC788\uC9C0\uB9CC \uBA54\uC778 \uBA54\uBAA8\uB9AC\uC640 \uB514\uC2A4\uD06C \uAC04\uC758 \uACFC\uB3C4\uD55C \uD398\uC774\uC9C0 \uAD50\uCCB4\uB85C \uC624\uBC84\uD5E4\uB4DC\uB97C \uC99D\uAC00\uC2DC\uCF1C \uC2DC\uC2A4\uD15C\uC758 \uC131\uB2A5\uC744 \uB5A8\uC5B4\uB728\uB9B0\uB2E4\uB294 \uB2E8\uC810\uC774 \uC788\uB2E4.</p><ul><li><strong>\uD544\uC694\uD560 \uB54C\uB9CC \uD398\uC774\uC9C0 \uC801\uC7AC\uD55C\uB2E4.</strong> \uC694\uAD6C \uD398\uC774\uC9D5 \uAC00\uC0C1 \uBA54\uBAA8\uB9AC\uB97C \uC0AC\uC6A9\uD558\uBA74, \uD504\uB85C\uADF8\uB7A8 \uC2E4\uD589 \uC911 \uC694\uCCAD\uC774 \uC788\uC744 \uB54C\uB9CC \uD398\uC774\uC9C0\uAC00 \uB85C\uB4DC \uB41C\uB2E4.</li><li>\uC561\uC138\uC2A4 \uB418\uC9C0 \uC54A\uC740 \uD398\uC774\uC9C0\uB294 \uBB3C\uB9AC \uBA54\uBAA8\uB9AC\uC5D0 \uC801\uC7AC\uB418\uC9C0 \uC54A\uB294\uB2E4.</li><li>\uC2A4\uC651 \uC778, \uC2A4\uC651 \uC544\uC6C3\uC744 \uAD00\uB9AC\uD558\uB294 \uD398\uC774\uC800</li><li>\uBA54\uBAA8\uB9AC\uC5D0 \uC874\uC7AC\uD558\uB294 \uD398\uC774\uC9C0\uC640 \uB514\uC2A4\uD06C\uC5D0 \uC874\uC7AC\uD558\uB294 \uD398\uC774\uC9C0\uB97C \uAD6C\uBCC4\uD558\uAE30 \uC704\uD574 \uC5B4\uB5A4 \uD615\uD0DC\uC758 \uD558\uB4DC\uC6E8\uC5B4 \uC9C0\uC6D0\uC774 \uD544\uC694\uD558\uB2E4.</li></ul><p><strong>\uC720\uD6A8-\uBB34\uD6A8 \uBE44\uD2B8(valid-invalid bit)</strong></p><ul><li>\u2018valid\u2019\uB77C\uBA74, \uAD00\uB828 \uD398\uC774\uC9C0\uAC00 \uBA54\uBAA8\uB9AC\uC5D0 \uC874\uC7AC\uD568</li><li>\u2018invalid\u2019\uB77C\uBA74, \uD398\uC774\uC9C0\uAC00 \uC720\uD6A8\uD558\uC9C0 \uC54A\uAC70\uB098, \uC720\uD6A8\uD558\uC9C0\uB9CC \uD604\uC7AC \uBA54\uBAA8\uB9AC\uC5D0 \uC874\uC7AC\uD558\uC9C0 \uC54A\uACE0 \uBCF4\uC870 \uC800\uC7A5\uC18C\uC5D0 \uC788\uB2E4\uB294 \uC758\uBBF8</li></ul><h2 id="\u1111\u1166\u110B\u1175\u110C\u1175-\u1111\u1169\u11AF\u1110\u1173-page-fault-\u1106\u116E\u1112\u116D\u1105\u1169-\u1111\u116D\u1109\u1175\u1103\u116C\u11AB-\u1111\u1166\u110B\u1175\u110C\u1175\u110B\u1166-\u1103\u1162\u1112\u1161\u11AB-\u110B\u1162\u11A8\u1109\u1166\u1109\u1173" tabindex="-1"><a class="header-anchor" href="#\u1111\u1166\u110B\u1175\u110C\u1175-\u1111\u1169\u11AF\u1110\u1173-page-fault-\u1106\u116E\u1112\u116D\u1105\u1169-\u1111\u116D\u1109\u1175\u1103\u116C\u11AB-\u1111\u1166\u110B\u1175\u110C\u1175\u110B\u1166-\u1103\u1162\u1112\u1161\u11AB-\u110B\u1162\u11A8\u1109\u1166\u1109\u1173" aria-hidden="true">#</a> \uD398\uC774\uC9C0 \uD3F4\uD2B8(Page fault) : \uBB34\uD6A8\uB85C \uD45C\uC2DC\uB41C \uD398\uC774\uC9C0\uC5D0 \uB300\uD55C \uC561\uC138\uC2A4</h2><p><strong>\uD398\uC774\uC9C0 \uD3F4\uD2B8 \uCC98\uB9AC\uC808\uCC28</strong></p><ol><li>\uC720\uD6A8\uD55C \uBA54\uBAA8\uB9AC \uC811\uADFC\uC778\uC9C0 , \uBB34\uD6A8\uD55C \uBA54\uBAA8\uB9AC \uC811\uADFC\uC778\uC9C0 \uD655\uC778\uC744 \uC704\uD574 \uD504\uB85C\uC138\uC2A4 \uB0B4\uBD80 \uD14C\uC774\uBE14\uC744 \uD655\uC778</li><li>\uC720\uD6A8\uD558\uC9C0 \uC54A\uC740 \uACBD\uC6B0 \uD504\uB85C\uC138\uC2A4\uB97C \uC885\uB8CC. \uC720\uD6A8\uD558\uC9C0\uB9CC \uC544\uC9C1 \uD574\uB2F9 \uD398\uC774\uC9C0\uB97C \uAC00\uC838\uC624\uC9C0 \uC54A\uC740 \uACBD\uC6B0 \uD398\uC774\uC9C0\uB97C \uC785\uB825</li><li>\uBE44\uC5B4\uC788\uB294 \uD504\uB808\uC784 \uAC80\uC0C9</li><li>\uC6D0\uD558\uB294 \uD398\uC774\uC9C0\uB97C \uC0C8\uB85C \uD560\uB2F9\uB41C \uD504\uB808\uC784\uC73C\uB85C \uC77D\uC5B4 \uB4E4\uC774\uAE30 \uC704\uD574 2\uCC28 \uC800\uC7A5\uC791\uC5C5\uC744 \uC608\uC57D</li><li>\uC800\uC7A5\uC18C \uC77D\uAE30\uAC00 \uC644\uB8CC\uB418\uBA74 \uD504\uB85C\uC138\uC2A4\uC640 \uD568\uAED8 \uC720\uC9C0\uB418\uB294 \uB0B4\uBD80 \uD14C\uC774\uBE14\uACFC \uD398\uC774\uC9C0 \uD14C\uC774\uBE14\uC744 \uC218\uC815\uD558\uC5EC \uD398\uC774\uC9C0\uAC00 \uD604\uC7AC \uBA54\uBAA8\uB9AC\uC5D0 \uC788\uC74C\uC744 \uB098\uD0C0\uB0C4</li><li>\uD2B8\uB7A9\uC5D0 \uC758\uD574 \uC911\uB2E8\uB41C \uBA85\uB839\uC744 \uC7AC\uAC1C. \uD504\uB85C\uC138\uC2A4\uB294 \uBA54\uBAA8\uB9AC\uC5D0 \uC788\uC5C8\uB358 \uAC83\uCC98\uB7FC \uD398\uC774\uC9C0 \uC561\uC138\uC2A4 \uAC00\uB2A5</li></ol><h2 id="\u1111\u1166\u110B\u1175\u110C\u1175-\u1103\u1162\u110E\u1175-\u1100\u116D\u110E\u1166" tabindex="-1"><a class="header-anchor" href="#\u1111\u1166\u110B\u1175\u110C\u1175-\u1103\u1162\u110E\u1175-\u1100\u116D\u110E\u1166" aria-hidden="true">#</a> \uD398\uC774\uC9C0 \uB300\uCE58(\uAD50\uCCB4)</h2><p>\uD398\uC774\uC9C0 \uB300\uCE58\uB294 \uD398\uC774\uC9C0 \uBD80\uC7AC\uAC00 \uBC1C\uC0DD\uD558\uBA74 \uBA54\uC778 \uBA54\uBAA8\uB9AC\uC5D0 \uC788\uC73C\uBA74\uC11C \uC0AC\uC6A9\uD558\uC9C0 \uC54A\uB294 \uD398\uC774\uC9C0\uB97C \uB514\uC2A4\uD06C\uB85C \uB0B4\uBCF4\uB0B4\uACE0 \uC0C8\uB85C\uC6B4 \uD398\uC774\uC9C0\uB85C \uBC14\uAFB8\uB294 \uACFC\uC815\uC774\uB2E4. \uC720\uD6A8-\uBB34\uD6A8 \uBE44\uD2B8\uB97C \uD655\uC778\uD558\uC5EC \uD544\uC694\uC2DC \uD398\uC774\uC9C0 \uAD50\uCCB4\uD55C\uB2E4. \uB0B4\uBCF4\uB0BC \uD398\uC774\uC9C0\uB97C \uACE0\uB97C \uB54C\uB294 \uC2DC\uC2A4\uD15C\uC758 \uD6A8\uC728\uC131\uC5D0 \uC601\uD5A5\uC744 \uC8FC\uBBC0\uB85C LRU, FIFO \uC801\uC6A9\uD574\uC11C \uAD50\uCCB4\uBC29\uC548, \uAD50\uCCB4 \uC54C\uACE0\uB9AC\uC998\uC744 \uACE0\uBBFC\uD574\uC57C \uD55C\uB2E4.</p><h2 id="\u1103\u1162\u110E\u1175-\u110B\u1161\u11AF\u1100\u1169\u1105\u1175\u110C\u1173\u11B7" tabindex="-1"><a class="header-anchor" href="#\u1103\u1162\u110E\u1175-\u110B\u1161\u11AF\u1100\u1169\u1105\u1175\u110C\u1173\u11B7" aria-hidden="true">#</a> \uB300\uCE58 \uC54C\uACE0\uB9AC\uC998</h2><ul><li><p>\uC120\uC785\uC120\uCD9C \uB300\uCE58 \uC54C\uACE0\uB9AC\uC998</p></li><li><p>\uCD5C\uC801 \uD398\uC774\uC9C0 \uB300\uCE58 \uC54C\uACE0\uB9AC\uC998</p></li><li><p>\uCD5C\uADFC \uCD5C\uC18C \uC0AC\uC6A9 \uB300\uCE58 \uC54C\uACE0\uB9AC\uC998</p></li><li><p>\uCD5C\uADFC \uCD5C\uC18C \uC0AC\uC6A9 \uADFC\uC811 \uC54C\uACE0\uB9AC\uC998</p></li></ul><h2 id="\u1111\u1173\u1105\u1166\u110B\u1175\u11B7-\u1112\u1161\u11AF\u1103\u1161\u11BC-\u110B\u1161\u11AF\u1100\u1169\u1105\u1175\u110C\u1173\u11B7" tabindex="-1"><a class="header-anchor" href="#\u1111\u1173\u1105\u1166\u110B\u1175\u11B7-\u1112\u1161\u11AF\u1103\u1161\u11BC-\u110B\u1161\u11AF\u1100\u1169\u1105\u1175\u110C\u1173\u11B7" aria-hidden="true">#</a> \uD504\uB808\uC784 \uD560\uB2F9 \uC54C\uACE0\uB9AC\uC998</h2><p>\uD398\uC774\uC9C0 \uBD80\uC7AC(\uC800\uC7A5\uD558\uC9C0 \uC54A\uC740 \uD398\uC774\uC9C0 \uC0AC\uC6A9\uD558\uB824\uACE0 \uD560 \uB54C \uB098\uD0C0\uB098\uB294 \uD604\uC0C1)\uB97C \uC904\uC774\uB824\uBA74 \uD504\uB808\uC784\uC744 \uD560\uB2F9\uD558\uB294 \uBC29\uBC95\uB3C4 \uB9E4\uC6B0 \uC911\uC694\uD558\uB2E4.</p><ul><li>\uADE0\uC77C \uD504\uB808\uC784 \uD560\uB2F9 \uC54C\uACE0\uB9AC\uC998 : \uAC01 \uD504\uB85C\uC138\uC2A4\uC5D0 \uB611\uAC19\uC774 \uD504\uB808\uC784\uC744 m/n \uAC1C\uC529 \uD560\uB2F9\uD558\uB294 \uBC29\uBC95</li><li>\uBE44\uB840 \uD504\uB808\uC784 \uD560\uB2F9 \uC54C\uACE0\uB9AC\uC998 : \uC0AC\uC6A9 \uAC00\uB2A5\uD55C \uBA54\uBAA8\uB9AC\uB97C \uAC01 \uD504\uB85C\uC138\uC2A4\uC758 \uD06C\uAE30\uC5D0 \uBE44\uB840\uD558\uC5EC \uD560\uB2F9\uD558\uB294 \uBC29\uBC95</li></ul><h2 id="\u110A\u1173\u1100\u1175-\u1109\u1175-\u1107\u1169\u11A8\u1109\u1161\u1105\u1161\u11AB" tabindex="-1"><a class="header-anchor" href="#\u110A\u1173\u1100\u1175-\u1109\u1175-\u1107\u1169\u11A8\u1109\u1161\u1105\u1161\u11AB" aria-hidden="true">#</a> \uC4F0\uAE30 \uC2DC \uBCF5\uC0AC\uB780</h2><ul><li>\uC4F0\uAE30 \uC2DC \uBCF5\uC0AC : \uD398\uC774\uC9C0\uB97C \uACF5\uC720(\uBD80\uBAA8,\uC790\uC2DD) write \uD560 \uB54C\uB9CC \uBCF5\uC0AC\uBCF8\uC744 \uC0DD\uC131\uD558\uC5EC \uBCC4\uB3C4 \uCC38\uC870</li><li>\uBD80\uBAA8 \uBC0F \uC790\uC2DD \uD504\uB85C\uC138\uC2A4\uAC00 \uCC98\uC74C\uC5D0 \uB3D9\uC77C\uD55C \uD398\uC774\uC9C0\uB97C \uACF5\uC720\uD558\uB3C4\uB85D \uD5C8\uC6A9\uD558\uC5EC \uC791\uB3D9</li><li>\uD504\uB85C\uC138\uC2A4 \uC911 \uD558\uB098\uAC00 \uACF5\uC720 \uD398\uC774\uC9C0\uC5D0 \uC4F0\uB294 \uACBD\uC6B0 \uACF5\uC720 \uD398\uC774\uC9C0\uC758 \uBCF5\uC0AC\uBCF8\uC774 \uC0DD\uC131</li><li>\uC608) \uC790\uC2DD \uD504\uB85C\uC138\uC2A4\uAC00 \uD398\uC774\uC9C0 \uC218\uC815\uC744 \uC2DC\uB3C4\uD55C\uB2E4\uBA74, <ul><li>\uC6B4\uC601 \uCCB4\uC81C\uB294 \uC774 \uD398\uC774\uC9C0\uC758 \uBCF5\uC0AC\uBCF8\uC744 \uC0DD\uC131\uD558\uC5EC \uC790\uC2DD \uD504\uB85C\uC138\uC2A4\uC758 \uC8FC\uC18C \uACF5\uAC04\uC5D0 \uB9E4\uD551</li><li>\uC790\uC2DD \uD504\uB85C\uC138\uC2A4\uB294 \uBD80\uBAA8 \uD504\uB85C\uC138\uC2A4\uC5D0 \uC18D\uD55C \uD398\uC774\uC9C0\uAC00 \uC544\uB2CC \uBCF5\uC0AC\uB41C \uD398\uC774\uC9C0\uB97C \uC218\uC815</li></ul></li></ul><h2 id="\u1109\u1173\u1105\u1166\u1109\u1175\u11BC-\u1106\u116E\u11AB\u110C\u1166" tabindex="-1"><a class="header-anchor" href="#\u1109\u1173\u1105\u1166\u1109\u1175\u11BC-\u1106\u116E\u11AB\u110C\u1166" aria-hidden="true">#</a> \uC2A4\uB808\uC2F1 \uBB38\uC81C</h2><ul><li>\uC2A4\uB808\uC2F1: \uD398\uC774\uC9C0\uB97C \uAD50\uCCB4\uD558\uACE0 \uBC18\uBCF5\uD574\uC11C \uD398\uC774\uC9D5 \uC791\uC5C5\uC774 \uBC1C\uC0DD\uD558\uB294 \uC0C1\uD669. (\uC790\uAE30\uAC00 \uD560 \uC77C\uBCF4\uB2E4 \uAD50\uCCB4\uC5D0 \uC2DC\uAC04\uC744 \uB9CE\uC774 \uC4F0\uB294 \uC0C1\uD669, \uBE44\uD6A8\uC728</li><li>\uC2A4\uB808\uC2F1\uC81C\uD55C : \uC9C0\uC5ED\uAD50\uCCB4 \uC54C\uACE0\uB9AC\uC998, \uC6B0\uC120\uC21C\uC704 \uAD50\uCCB4 \uC54C\uACE0\uB9AC\uC998</li><li>\uC2A4\uB808\uC2F1 \uBC29\uC9C0 : \uC791\uC5C5 \uC9D1\uD569 \uBAA8\uB378, \uD398\uC774\uC9C0 \uD3F4\uD2B8 \uBE48\uB3C4</li></ul><h2 id="\u110C\u1175\u110B\u1167\u11A8\u1109\u1165\u11BC" tabindex="-1"><a class="header-anchor" href="#\u110C\u1175\u110B\u1167\u11A8\u1109\u1165\u11BC" aria-hidden="true">#</a> \uC9C0\uC5ED\uC131</h2><p>\uD504\uB85C\uC138\uC2A4\uAC00 \uC5B4\uB290 \uC2E4\uD589 \uB2E8\uACC4 \uB3D9\uC548 \uBA54\uBAA8\uB9AC\uC758 \uC815\uBCF4\uB97C \uADE0\uC77C\uD558\uAC8C \uC5D1\uC138\uC2A4 \uD558\uB294 \uAC83\uC774 \uC544\uB2C8\uB77C \uC120\uD638\uD558\uB294 \uD2B9\uC815 \uD398\uC774\uC9C0\uB9CC \uC9D1\uC911\uC801\uC73C\uB85C \uCC38\uC870\uD558\uB294 \uD604\uC0C1\uC774\uB2E4.</p><ul><li>\uC2DC\uAC04 \uC9C0\uC5ED\uC131</li><li>\uACF5\uAC04\uC9C0\uC5ED\uC131</li></ul><h2 id="\u110C\u1161\u11A8\u110B\u1165\u11B8-\u110C\u1175\u11B8\u1112\u1161\u11B8-\u1106\u1169\u1103\u1166\u11AF" tabindex="-1"><a class="header-anchor" href="#\u110C\u1161\u11A8\u110B\u1165\u11B8-\u110C\u1175\u11B8\u1112\u1161\u11B8-\u1106\u1169\u1103\u1166\u11AF" aria-hidden="true">#</a> \uC791\uC5C5 \uC9D1\uD569 \uBAA8\uB378</h2><p>\uD504\uB85C\uC138\uC2A4\uAC00 \uB9CE\uC774 \uCC38\uC870\uD558\uB294 \uD398\uC774\uC9C0 \uC9D1\uD569\uC744 \uBA54\uBAA8\uB9AC \uACF5\uAC04\uC5D0 \uACC4\uC18D \uC0C1\uC8FC\uC2DC\uCF1C \uBE48\uBC88\uD55C \uD398\uC774\uC9C0 \uB300\uCE58 \uD604\uC0C1\uC744 \uC904\uC774\uB3C4\uB85D \uD504\uB85C\uADF8\uB7A8 \uC218\uD589\uACFC\uC815\uC744 \uC9C0\uC5ED\uC131\uC73C\uB85C \uC124\uBA85\uD558\uB294 \uBAA8\uB378\uC774\uB2E4.</p><ul><li>\uC791\uC5C5 \uC9D1\uD569\uD06C\uAE30\uAC00 \uC791\uACE0 \uD398\uC774\uC9C0 \uD504\uB808\uC784 \uC218\uAC00 \uC801\uC73C\uBA74, \uD398\uC774\uC9C0 \uBD80\uC7AC \uBE44\uC728\uC774 \uB192\uC544 \uC2A4\uB798\uC2F1 \uD604\uC0C1\uC744 \uC77C\uC73C\uD0AC \uC218 \uC788\uB2E4.</li><li>\uC791\uC5C5 \uC9D1\uD569 \uD06C\uAE30\uAC00 \uD06C\uACE0 \uD398\uC774\uC9C0 \uD504\uB808\uC784 \uC218\uAC00 \uB9CE\uC73C\uBA74 \uD504\uB85C\uC138\uC2A4\uC758 \uC2E4\uC81C \uC791\uC5C5 \uD398\uC774\uC9C0\uC640 \uB2E4\uB978 \uD398\uC774\uC9C0 \uAE4C\uC9C0 \uBA54\uBAA8\uB9AC\uB97C \uCC28\uC9C0\uD558\uC5EC \uBA54\uBAA8\uB9AC \uB0AD\uBE44\uC640 \uB2E4\uC911 \uD504\uB85C\uADF8\uB798\uBC0D \uC815\uB3C4\uB97C \uAC10\uC18C \uC2DC\uD0AC\uC218\uC788\uB2E4.</li></ul><h2 id="\u1111\u1166\u110B\u1175\u110C\u1175-\u1107\u116E\u110C\u1162\u1107\u1175\u110B\u1172\u11AF" tabindex="-1"><a class="header-anchor" href="#\u1111\u1166\u110B\u1175\u110C\u1175-\u1107\u116E\u110C\u1162\u1107\u1175\u110B\u1172\u11AF" aria-hidden="true">#</a> \uD398\uC774\uC9C0 \uBD80\uC7AC\uBE44\uC728</h2><p>\uD398\uC774\uC9C0 \uBD80\uC7AC \uBE44\uC728 (PFF, Page Fault Frequency)\uC740 \uC2A4\uB798\uC2F1\uC744 \uC608\uBC29\uD558\uB294 \uC9C1\uC811\uC801\uC778 \uC5D1\uC138\uC2A4 \uBC29\uBC95 \uC73C\uB85C, \uD398\uC774\uC9C0 \uD658\uACBD\uC5D0\uC11C \uD504\uB85C\uC138\uC2A4\uC758 \uC2E4\uD589\uC744 \uCE21\uC815\uD558\uB294 \uAE30\uC900\uC774 \uB41C\uB2E4. \uD398\uC774\uC9C0 \uBD80\uC7AC \uBE44\uC728\uC774 \uC0C1\uD55C \uAC12\uC744 \uB118\uC73C\uBA74 \uD504\uB85C\uC138\uC2A4\uC5D0 \uB2E4\uB978 \uD504\uB808\uC784\uC744 \uB354 \uD560\uB2F9\uD55C\uB2E4. \uD558\uD55C \uAC12\uBCF4\uB2E4 \uB0AE\uC73C\uBA74 \uD504\uB808\uC784\uC744 \uD68C\uC218\uD558\uC5EC \uC2A4\uB798\uC2F1\uC744 \uBC29\uC9C0\uD558\uBA74\uC11C \uD398\uC774\uC9C0 \uBD80\uC7AC\uBE44\uC728\uC744 \uCE21\uC815 \uC870\uC808\uD558\uC5EC\uC11C \uC791\uC5C5 \uC9D1\uD569 \uBAA8\uB378\uBCF4\uB2E4 \uC624\uBCA0\uD5E4\uB4DC\uAC00 \uC801\uB2E4.</p><h2 id="\u1109\u1175\u1109\u1173\u1110\u1166\u11B7-\u1109\u1165\u11BC\u1102\u1173\u11BC\u110B\u1173\u11AF-\u1112\u1163\u11BC\u1109\u1161\u11BC\u1109\u1175\u110F\u1175\u1102\u1173\u11AB-\u1100\u1175\u1110\u1161-\u110B\u1175\u1109\u1172" tabindex="-1"><a class="header-anchor" href="#\u1109\u1175\u1109\u1173\u1110\u1166\u11B7-\u1109\u1165\u11BC\u1102\u1173\u11BC\u110B\u1173\u11AF-\u1112\u1163\u11BC\u1109\u1161\u11BC\u1109\u1175\u110F\u1175\u1102\u1173\u11AB-\u1100\u1175\u1110\u1161-\u110B\u1175\u1109\u1172" aria-hidden="true">#</a> \uC2DC\uC2A4\uD15C \uC131\uB2A5\uC744 \uD5A5\uC0C1\uC2DC\uD0A4\uB294 \uAE30\uD0C0 \uC774\uC288</h2><p>\uAC00\uC0C1 \uBA54\uBAA8\uB9AC\uC758 \uD398\uC774\uC9C0 \uBC29\uBC95\uC5D0\uC11C \uD560\uB2F9 \uC54C\uACE0\uB9AC\uC998\uACFC \uB300\uCE58 \uC54C\uACE0\uB9AC\uC998 \uC801\uC7AC \uC815\uCC45\uC774\uC678\uC5D0 \uC2DC\uC2A4\uD15C \uC131\uB2A5\uC5D0 \uC601\uD5A5\uC744 \uBBF8\uCE58\uB294 \uCCAB \uBC88\uC9F8 \uC694\uC18C\uB294 \uD504\uB808\uC784 \uD560\uB2F9 \uAE30\uC900\uC73C\uB85C \uD398\uC774\uC9C0 \uB300\uCE58 \uBC94\uC704\uB97C \uBAA8\uB4E0 \uD504\uB85C\uC138\uC2A4\uC5D0 \uC801\uC801\uC6A9\uD558\uB294 \uC804\uC5ED \uB300\uCE58\uC640 \uD504\uB85C\uC138\uC2A4\uB97C \uAC1C\uBCC4\uC801\uC73C\uB85C \uC81C\uD55C \uD558\uB294 \uC9C0\uC5ED \uB300\uCE58\uAC00 \uC788\uB2E4. \uB450 \uBC88\uC9F8 \uC694\uC18C\uB294 \uC608\uC0C1\uB418\uB294 \uBAA8\uB4E0 \uD398\uC774\uC9C0\uB97C \uC0AC\uC804\uC5D0 \uD55C\uAEBC\uBC88\uC5D0 \uBA54\uBAA8\uB9AC\uB85C \uAC00\uC838\uC624\uB294 \uD504\uB9AC\uD398\uC774\uC9D5(prepaging)\uBC29\uBC95\uC774\uB2E4. \uB610 \uD398\uC774\uC9C0 \uD14C\uC774\uBE14\uC758 \uD06C\uAE30\uC640 \uD398\uC774\uC9C0 \uD14C\uC774\uBE14 \uAD6C\uC870(\uC5ED \uD398\uC774\uC9C0 \uD14C\uC774\uBE14\uC758 \uAD6C\uC870, \uBCC0\uD658 \uC6B0\uC120\uCC38\uC870 \uBC84\uD37C) \uB4F1\uB3C4 \uACE0\uB824\uD574\uC57C \uD55C\uB2E4.</p>',33),d=[h];function t(n,u){return l(),a("div",null,d)}var p=i(r,[["render",t],["__file","ch13-\uAC00\uC0C1\uBA54\uBAA8\uB9AC.html.vue"]]);export{p as default};
